import { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { Container, Row, Col, Card, CardBody, Form, FormGroup, Label, Input, Button, Alert } from "reactstrap";

const Login = ({ setUserRole }) => {
  const [message, setMessage] = useState({ text: "", type: "" });
  const navigate = useNavigate();

  const handleStudentLogin = (e) => {
    e.preventDefault();
    const username = e.target.username.value;
    const password = e.target.password.value;

    // تحقق الطلاب (مثال)
    if (username && password) {
      setMessage({ text: "تم تسجيل دخول الطالب بنجاح!", type: "success" });
      setUserRole("student");
      navigate("/dashboard"); // توجيه الطلاب
    } else {
      setMessage({ text: "خطأ! تحقق من اسم المستخدم أو كلمة المرور.", type: "danger" });
    }
  };

  const handleAdminLogin = (e) => {
    e.preventDefault();
    const adminCode = e.target.adminCode.value;

    // رمز الدخول الثابت للادمن
    const ADMIN_PASSWORD = "admin123";

    if (adminCode === ADMIN_PASSWORD) {
      setMessage({ text: "تم تسجيل دخول الادمن بنجاح!", type: "success" });
      setUserRole("admin");
      navigate("/admin"); // توجيه الادمن
    } else {
      setMessage({ text: "خطأ! رمز الادمن غير صحيح.", type: "danger" });
    }
  };

  return (
    <Container className="d-flex justify-content-center align-items-start py-5">
      <Row className="w-100 justify-content-center">
        <Col md="4">
          <Card className="shadow-lg p-4 mb-4">
            <CardBody>
              <h4 className="text-center mb-3">تسجيل دخول الطالب</h4>

              {message.text && <Alert color={message.type} className="text-center">{message.text}</Alert>}

              <Form onSubmit={handleStudentLogin}>
                <FormGroup>
                  <Label for="username">اسم المستخدم</Label>
                  <Input type="text" id="username" name="username" placeholder="ادخل اسم المستخدم" required />
                </FormGroup>
                <FormGroup>
                  <Label for="password">كلمة المرور</Label>
                  <Input type="password" id="password" name="password" placeholder="ادخل كلمة المرور" required />
                </FormGroup>

                <Button color="primary" className="w-100 mt-3" type="submit">Login</Button>
              </Form>

              <div className="text-center mt-3">
                <span>لا يوجد حساب؟ </span>
                <Link to="/register">Register</Link>
              </div>
            </CardBody>
          </Card>

          <Card className="shadow-lg p-4">
            <CardBody>
              <h4 className="text-center mb-3">تسجيل دخول الادمن</h4>

              <Form onSubmit={handleAdminLogin}>
                <FormGroup>
                  <Label for="adminCode">رمز الادمن</Label>
                  <Input type="password" id="adminCode" name="adminCode" placeholder="ادخل رمز الادمن" required />
                </FormGroup>

                <Button color="danger" className="w-100 mt-3" type="submit">Login</Button>
              </Form>
            </CardBody>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default Login;
